syntax "proto3";

package aws;

message AwsStoragegatewayCachedIscsiVolume {
  arn = 1;
  chap_enabled = 2;
  gateway_arn = 3;
  id = 4;
  lun_number = 5;
  network_interface_id = 6;
  network_interface_port = 7;
  snapshot_id = 8;
  source_volume_arn = 9;
  tags = 10;
  target_arn = 11;
  target_name = 12;
  volume_arn = 13;
  volume_id = 14;
  volume_size_in_bytes = 15;
}